function nextStep() {
    var date = new Date();
    this.stepsSinceTick ++;
    var nowMS = date.getTime();
    this.maxLatency = Math.max(this.maxLatency, nowMS - this.lastMS);
    this.lastMS = nowMS;
    var nowTick = date.getSeconds();
    if (nowTick != this.lastTick) {
        this.lastTick = nowTick;
        var ms = (1000 / Math.max(this. stepsSinceTick,1)).roundTo(1);
        this.fps = this.stepsSinceTick;
        this.get('fpsText').textString = this.stepsSinceTick + " frames/sec (" + ms + "ms avg),\nmax latency " + this.maxLatency + " ms.";
        this.reset(date);
    }
}

